import React from 'react';
import { BrowserRouter as Router, Link } from 'react-router-dom';
import AppRoutes from './routes';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li><Link to="/">Glavni Izbornik</Link></li>
            <li><Link to="/login">Login Page</Link></li>
            {/* Dodajte Link komponente za ostale stranice ovdje */}
          </ul>
        </nav>
        <AppRoutes />
      </div>
    </Router>
  );
}

export default App;
